"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Conjunctivitis (pinkeye) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/conjunctivitis-pinkeye-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H482219652\">",
"      <span class=\"h1\">",
"       What is pinkeye?",
"      </span>",
"      &nbsp;&mdash;&nbsp;&ldquo;Pinkeye&rdquo; is the everyday term people use to describe an infection or irritation of the eye. The medical term for pinkeye is &ldquo;conjunctivitis.&rdquo;",
"     </p>",
"     <p>",
"      If you have pinkeye, your eye (or eyes) may:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Turn red or pink",
"       </li>",
"       <li>",
"        Weep or ooze a gooey liquid",
"       </li>",
"       <li>",
"        Become itchy or burn",
"       </li>",
"       <li>",
"        Get stuck shut",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Pinkeye can be caused by an infection, allergies, or an unknown irritation.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H482219659\">",
"      <span class=\"h1\">",
"       Can you catch pinkeye from someone else?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. When pinkeye is caused by an infection, it can spread easily. Usually, people catch it from touching something that has touched an infected person&rsquo;s eye.",
"     </p>",
"     <p>",
"      If you know someone with pinkeye, avoid touching his or her pillowcases, towels, or other personal items.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H482219666\">",
"      <span class=\"h1\">",
"       When should I see my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse if your eye is red, oozing, or in pain.",
"      <strong>",
"      </strong>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H482219673\">",
"      <span class=\"h1\">",
"       Can pinkeye be treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most cases of pinkeye go away on their own, without treatment. But, yes, it can be treated.",
"     </p>",
"     <p>",
"      Pinkeye caused by an infection with bacteria can be treated with antibiotic eye drops or gels. Pinkeye caused by other problems can be treated with eye drops normally used to treat allergies. These drops will not cure the pinkeye, but they can help with itchiness and irritation. People with dry eyes can use medicine-free eye drops to wet the eyes.",
"     </p>",
"     <p>",
"      When using eye drops for infection, do not let drops trickle from one eye to the other. Also, do not touch your good eye after touching your affected eye. Both of these things can cause the infection to spread from one eye to the other.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H482219680\">",
"      <span class=\"h1\">",
"       What if I wear contact lenses?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you wear contact lenses and you have symptoms of pinkeye, it is really important to have a doctor look at your eyes. In people who wear contacts, the symptoms of pinkeye can be caused by serious problems.",
"     </p>",
"     <p>",
"      During treatment for eye infections, you may need to stop wearing your contacts for a short time. Plus, you may need to throw away your contact lens case and carefully clean your contacts. If your contacts are disposable, you will want to throw them away and start fresh.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H482219687\">",
"      <span class=\"h1\">",
"       Can pinkeye be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To keep from getting or spreading pinkeye, wash your hands often with soap and water. If washing is not possible, alcohol-based hand gels work, too. Also, avoid sharing towels, bed clothes, or other personal items with a person who has pinkeye.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H482219694\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?19/51/20274?source=see_link\">",
