var title_f26_6_26729="DHR test";
var content_f26_6_26729=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F68461&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F68461&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 626px\">",
"   <div class=\"ttl\">",
"    DHR test",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 606px; height: 771px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Dihydrorhodamine assay for CGD diagnosis. Unstimulated (left) and phorbol myristate acetate stimulated (right) neutrophils are shown. Y axis is number of events, X axis is fluorescence intensity shown on a log scale. In the normal (top panels) there is a rightward shift seen with stimulation. In the X-linked CGD carrier state (second row), there are 2 populations seen: one is normally fluorescent, while the other is essentially the same as the unstimulated population. In the patient with X-linked CGD (third row) there is no shift in fluorescence with stimulation. In the patient with the autosomal recessive p47phox deficiency (fourth row), the rightward shift seen with stimulation is abnormally broad and not very bright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Tracings courtesy of Dr. Douglas B. Kuhns, SAIC Frederick.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
